Step-by-step reasoning:

1. Key psychological mechanisms:
 • A self‐interest drive: responders value the actual monetary offer received (split_self).
 • A fairness reference: responders compare the received offer to a “fair share” based on their token contribution relative to the total (token_self relative to token_self+token_opp) multiplied by the combined_earning.
 • Diminishing sensitivity: the impact of differences between the offer and the fair share need not increase linearly; large deviations may “saturate” in their effect.

2. How these mechanisms interact:
 • The offered money is first valued linearly by a self‐interest factor (γ).
 • Then, the deviation from the fair share (d = split_self − fair_share) is adjusted through a saturating function, capturing diminishing sensitivity. This fairness adjustment is scaled by a fairness sensitivity parameter (λ). When the offer deviates only slightly from the fair share, the adjustment is almost linear; when the deviation is large, its marginal influence is reduced.

3. Mathematical form:
 • Compute fair_share as: (token_self / (token_self + token_opp))×combined_earning.
 • Calculate the deviation: d = split_self − fair_share.
 • The fairness adjustment is then given by λ·[d / (1 + |d|/combined_earning)] so that extreme deviations are dampened.
 • Finally, the total utility for accepting an offer is the sum of the linear self‐interest component and the fairness adjustment.

4. Learnable parameters:
 • γ (gamma): governing the weight placed on the monetary offer.
 • λ (lambda): governing the strength of the fairness adjustment.
 Both parameters are constrained to be positive with generous bounds to facilitate parameter recovery.

5. Mapping to observable behavior:
 • Observed variables (split_self, token_self, token_opp, combined_earning) are used to first compute the fair share and then the deviation.
 • The computed utility U_accept, combining self-interest and normalized fairness deviation, accounts for why a responder may accept an offer.
 • Negative utility (from a low offer relative to the fair share) would predict a low probability of acceptance, while positive utility predicts acceptance.

Below is the formal specification:

<MODEL>
Let fair_share = (token_self / (token_self + token_opp)) × combined_earning  
Let d = split_self - fair_share  
U_accept = gamma × split_self + lambda × ( d / (1 + |d|/combined_earning) )
</MODEL>

